                    </div>
                    <div className="back" /> {/*FIXES FONT RENDERING */}
                </div>
            </section>
            <section className="tooltip">
                <p>
                    Hover over the card to see the back.
          </p>
            </section>
        </div>

    );
} export default EventItem;
